import React from "react"
import styled from "styled-components"

const TodosList = () => {

    return (
        <TodosListCtn>
            <HomeMenuName>
                우리가 할일
            </HomeMenuName>
            <HomeMenuBtn>
                <HomeMenuTitle>할일 기록하기</HomeMenuTitle>
            </HomeMenuBtn>
            <HomeMenuBtn>
                <HomeMenuTitle>TODO LIST</HomeMenuTitle>
            </HomeMenuBtn>
        </TodosListCtn>
    )
}

const TodosListCtn = styled.div`
    display: flex;
    flex-direction: column;
    gap: 20px;
    padding: 20px;
    box-sizing: border-box;
`
const HomeMenuName = styled.h2`
    margin-top: 40px;
    font-size: 3rem;
    font-weight: 400;
    margin-bottom: 20px;
`
const HomeMenuBtn = styled.div`
    border: 1px solid #ddd;
    border-radius: 10px;
    padding: 40px 20px;
    height: 60px;
    display: flex;
    justify-content: space-between;
    align-items: center;
`
const HomeMenuTitle = styled.h3`
    font-size: 24px;
    font-weight: 400;
`


export default TodosList
